const table = document.getElementsbyId('gurumi')
const cells = table.getElementsByClassName('image1')
const positions = table.getElementsByClassName('gurumi image2')

function AI() {
    var max = 0
    var max_position
    positions.forEach((position, index) => {
        if (max < parseInt(position.innerHTML)) {
            max = parseInt(position.innerHTML)
            max_position = index
        }
    })
    
    if (max_position) {
        cells[max_position].click()
        // console.log(document.getElementById(max_position))
        console.log(max_position)
    }
}

function StartPlaying() {
    setInterval(AI, 1000)
}

export default AI
